  [],\n\t\"revision_timestamp\": \"2015-05-07T00:06:32.087971\",\n\t\"name\": \"global-rural-urban-mapping-project-grump-alpha-version\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Global Rural-Urban Mapping Project (GRUMP),
  Alpha Version consists of estimates of human population for the years 1990, 1995,
  and 2000 by 30 arc-second (1km) grid cells and associated datasets dated circa 2000.
  The data products include population count grids (raw counts), population density
  grids (per square km), land area grids (actual area net of ice and water), mean
  geographic unit area grids, urban extents grids, centroids, a national identifier
  grid, national boundaries, coastlines, and settlement points. These products vary
  in GIS-compatible data formats and geographic extents (global, continent [Antarctica
  not included], and country levels). A proportional allocation gridding algorithm,
  utilizing more than 1,000,000 national and sub-national geographic units, is used
  to assign population values to grid cells. Additional global grids are created from
  the 30 arc-second grid at 1/4, 1/2, and 1 degree resolutions. The Spatial Reference
  metadata section information applies only to global extent, 30 arc-second resolution.
  This dataset is produced by the Columbia University Center for International Earth
  Science Information Network (CIESIN) in collaboration with the International Food
  Policy Research Institute (IFPRI), The World Bank, and Centro Internacional de Agricultura
  Tropical (CIAT). (Suggested Usage: To allow analysis of urban and rural population
  figures based on a consistent global dataset.)\",\n\t\"license_title\": \"U.S. Government
